function Enum(a) {
  var i = Object.keys(a).reduce(function (o, k) {
    return o[a[k]] = k, o;
  }, {});
  return Object.freeze(Object.keys(a).reduce(function (o, k) {
    return o[k] = a[k], o;
  }, function (v) {
    return i[v];
  }));
}

